            "presenter":"Human Computation Institute",
            "goal":"Speed up Alzheimer's research",
            "task":"Report stalls, clogged blood vessels, in movies of mouse brains",
            "description":"Help scientists analyze movies from the brain affected with Alzheimer\u2019s - are the blood vessels flowing or stalled?\r\n\r\nToday, there is no treatment for Alzheimer's. Together with researchers at Cornell University, we have a goal to change that. We\u2019re focusing on one aspect of the disease: reduced blood flow in the brain. It\u2019s a symptom that has been known for years, but until now, nobody knew why it happens. \r\n\r\nOur collaborators recently discovered that stalls (clogged blood vessels in the brain) are responsible for this blood flow reduction in mice with Alzheimer\u2019s. By reducing the number of stalls, the lab was able to restore memory and reduce other cognitive symptoms in mice.\r\n\r\nBut to fully understand how stalls are contributing to Alzheimer\u2019s and discover potential treatment targets, we need to get through lots of data. We need your keen eyes for that - even the most powerful computer technologies can\u2019t do that accurately enough yet. Without the help of the crowd, this process could take decades. \r\n\r\nIn Stall Catchers we \u201ccatch\u201d stalls by looking at movies from the brain of mice and scoring blood vessels as \u201cflowing\u201d or \u201cstalled\u201d. The game is easy enough to learn, and we help you out in the beginning! And even if you get a couple of questions wrong - don\u2019t worry. Each vessel will be seen by other citizen scientists so we can figure out the right answers together.\r\n\r\nWith your help, we could potentially find an effective treatment for Alzheimer's disease in just a few years - quick enough to make a difference in the lives of people who have the disease now.",
