         "instruction_steps_passive":[
            "Stall Catchers is a citizen science game speeding up Alzheimer's disease research at Cornell University.",
            "\r\nIn this game, you and your students will analyze microscope acquired movies from a live mouse brain!",
            "\r\nPlayers (you and your students) are looking for stalls - blocked blood vessels -that occur in the brain in Alzheimer's. Stalls are often caused by blood cells stuck inside inflamed blood vessels.",
            "\r\nBefore you get started, find the email address you used to create your SciStarter account.  If you are unsure which email you used, look at your SciStarter profile and click \"info and settings\" where you will find the email we have on file. You'll need this email address when you leave SciStarter to join this project. ",
            "\r\nClick Participate and you will be directed to StallCatchers.",
            "\r\nClick \"Join Now\" on the StallCatchers website.",
            "\r\nView the short Tutorial video then fill in the short registration form using the same email you used to sign up for SciStarter. Then, click \"Sign up\". TIP: you can opt in to receive materials about Alzheimer's disease from the BrightFocus Foundation by checking the appropriate box at registration.",
            "\r\nAfter you complete the registration, you will be taken to the game, where you can start, analyzing vessels right away! Don't forget to set your permanent password when you get a chance (a link to do so will be delivered by email).",
            "\r\nTo play a movie, scroll the horizontal bar below it; if you think the vessel is flowing, press the \u201cFlowing\u201d button; if you think the vessel is stalled, press the \u201cStalled\u201d button and click directly where you think the stall is located on the movie.",
            "\r\nAfter giving an answer, you will get some feedback on whether you have been \u201cCorrect\u201d, \u201cNot correct\u201d (for movies with known answers analyzed by experts) or \u201cMaybe\u201d (for movies which have not been analyzed by experts).",
            "\r\nIf in doubt, refer to the \u201cFAQ\u201d page in the \"Help\" section of the game, ask a question in the Forum. ",
            "\r\nEvery contribution, large or small, helps us get closer to the treatment!"
         ],
         "instruction_steps_active":[
            "Stall Catchers is a citizen science game speeding up Alzheimer's disease research at Cornell University.",
            "\r\nIn this game, you and your class will analyze microscope acquired movies from a live mouse brain!",
            "\r\nPlayers like you are looking for stalls - blocked blood vessels -that occur in the brain in Alzheimer's. Stalls are often caused by blood cells stuck inside inflamed blood vessels.",
            "\r\nYour teacher will click a Participate button on SciStarter.",
            "\r\nAs a class, you can start analyzing vessels.  ",
            "\r\nTo play a movie, scroll the horizontal bar below it; if you think the vessel is flowing, press the \u201cFlowing\u201d button; if you think the vessel is stalled, press the \u201cStalled\u201d button and click directly where you think the stall is located on the movie.",
            "\r\nAfter giving an answer, you will get some feedback on whether you have been \u201cCorrect\u201d, \u201cNot correct\u201d (for movies with known answers analyzed by experts) or \u201cMaybe\u201d (for movies which have not been analyzed by experts).",
            "\r\nIf in doubt, refer to the \u201cFAQ\u201d page in the \"Help\" section of the game, ask a question in the Forum. ",
            "\r\nEvery contribution, large or small, helps us get closer to the treatment!"
         ],
