         "description":"<p>Help scientists analyze movies from the brain affected with Alzheimer&rsquo;s - are the blood vessels flowing or stalled?</p><p>Today, there is no treatment for Alzheimer&#39;s. Together with researchers at Cornell University, we have a goal to change that. We&rsquo;re focusing on one aspect of the disease: reduced blood flow in the brain. It&rsquo;s a symptom that has been known for years, but until now, nobody knew why it happens.</p><p>Scientists recently discovered that stalls (clogged blood vessels in the brain) are responsible for this blood flow reduction in mice with Alzheimer&rsquo;s. By reducing the number of stalls, the lab was able to restore memory and reduce other cognitive symptoms in mice.</p><p>But to fully understand how stalls are contributing to Alzheimer&rsquo;s and discover potential treatment targets, they need to get through lots of data. Stall Catchers needs your keen eyes for that - even the most powerful computer technologies can&rsquo;t do that accurately enough yet. Without the help of the crowd, this process could take decades.</p><p>In Stall Catchers you will &nbsp;&ldquo;catch&rdquo; stalls by looking at movies from the brain of mice and scoring blood vessels as &ldquo;flowing&rdquo; or &ldquo;stalled&rdquo;. The game is easy enough to learn and even if you get a couple of questions wrong - don&rsquo;t worry. Each vessel will be seen by other citizen scientists so scientists can figure out the right answers together.</p><p>With your help, we could potentially find an effective treatment for Alzheimer&#39;s disease in just a few years - quick enough to make a difference in the lives of people who have the disease now.</p><p><br></p>",
         "thanks":"<p>Thank you for accelerating research on Alzheimer&#39;s.&nbsp;</p>",
         "time_required":"15 minutes",
