            "presenter":"National Optical Astronomy Observatory",
            "goal":"Raise awareness about light pollution.",
            "task":"Measure the night sky brightness.",
            "description":"Seven out of 10 people in the US have never seen our Milky Way Galaxy arch across their night sky from where they live. Have you? If so, you're lucky! If not, it's probably because of light pollution (too much outdoor lighting). \n\nLight pollution not only affects our view of the stars, but it also 1) wastes energy and money (about $2 to $10 billion a year!); 2) causes sleep disorders in people; and 3) disrupts the sleeping and breeding habits of animals like newly hatched sea turtles that try to find their way back into the moonlit ocean but get confused by streetlights and end up on streets instead.\n\nLight pollution may be a global problem, but the solutions are local and it starts with you. \n\nWith Globe at Night, citizen scientists match the appearance of a constellation they see with 7 star maps of progressively fainter stars. They then submit their choice of star map online with their date, time and location to help create a light pollution map worldwide. It's easy to get involved - all you need is computer or smart phone & follow these 6 Simple Steps!\n\nIf you want, you can compare your light pollution levels to other reports around the world. Ready? Click \"Join\" to get started!",
