            "prefix_how_to_logged_in":"<p>Good news! This is a SciStarter Affiliate project. You can earn credit in your <a href=\"https://scistarter.org/dashboard\" target=\"_blank\">SciStarter Dashboard</a> for your participation.</p><p>Click the <strong>Visit</strong> button on this page. You will be directed to the project&#39;s website.</p><p>Then, click &ldquo;<strong>Report</strong>&rdquo; in the top menu to contribute to Globe at Night.</p><p>Each time when you are done entering the data, remember to <strong>add the email address (case sensitive)</strong> you used to create your SciStarter account in the bottom right corner where you are invited to so that all your contributions to this project will be synced to your SciStarter Dashboard.</p>",
            "prefix_how_to_logged_out":"<p>Good news! This is a SciStarter Affiliate project. You can earn credit in your <a href=\"https://scistarter.org/dashboard\" target=\"_blank\">SciStarter Dashboard</a> for your participation.</p><p>Sign up or Log in to SciStarter. Your free account, while not required, enables your participation to be credited on your SciStarter Dashboard.</p><p>Click the <strong>Visit&nbsp;</strong>button on this page. You will be directed to the project&#39;s website or app and invited to create a project account there. <strong>Use the same email address (<em>case sensitive!</em>) you used to create your SciStarter account to join this project.</strong></p><p>Then, click &ldquo;<strong>Report</strong>&rdquo; in the top menu to contribute to Globe at Night.</p><p>Each time when you are done entering the data, remember to <strong>add the email address (case sensitive)</strong> you used to create your SciStarter account in the bottom right corner where you are invited to so that all your contributions to this project will be synced to your SciStarter Dashboard.</p>",
