         "instruction_steps_passive":[
            "With your teacher, review the Globe at Night Data Worksheet and constellation guide to find the latitude and longitude of the location where you are making your observation.",
            "Go outside with your class more than an hour after sunset (8-10 pm local time). Let your eyes become used to the dark for 10 minutes before your first observation.",
            "With your teacher, use the Globe at Night data sheet to record the date, time, location (latitude/longitude), the stars you can see, and the amount of cloud cover at the time of observation. ",
            "Make more observations from other locations, if possible. Compare your observation to thousands around the world!",
            "When you teacher marks this assignment as complete, you will see a Thank You video, view a Reflections Document for you to complete, and hear a fun Citizen Science song to celebrate your achievements!"
         ],
         "instruction_steps_active":[
            "Click and print the additional resource \"Data Worksheet\" above. It's helpful to review the questions on the worksheet before you get started and to take the worksheet with you when you observe the night sky. The Globe at Night website provides constellation guides.  ",
            "Go outside with your class more than an hour after sunset. Let your eyes become used to the dark for 10 minutes before your first observation.",
            "If you have a mobile device with Internet access when you observe, you can click \"Participate Now\" below to be directed to the Globe at Night website and, once there, click \"Report\" on the top menu bar to report your observation. If you just have your print worksheet with you, record your observation on it and submit the data online later. ",
            "Please remember to enter your SciStarter sign-up email at Question 6 in the online data submission form so that your contributions will be credited. ",
            "Make more observations from other locations, if possible. Compare your observation to thousands around the world!"
         ],
