            "description":"Volunteers around the world use mobile devices to hunt and collect virtual reality monsters for fun, but what if this energy could be directed at finding and identifying actual \u201cmonsters\u201d- the mosquitoes that serve as vectors for disease? That is our thinking in creating the GLOBE Observer Mosquito Habitat Mapper (GO Mosquito) app.  You will locate and map locations of breeding sites, and get points for decommissioning container habitats so that mosquito larvae don\u2019t develop into adult disease vectors.   Besides promoting the collection of critical data for use by scientists and health officials, GO Mosquito fosters understanding of the importance of personal action in reducing the local risk of vector-borne disease.",
