         "instruction_steps_passive":[
            "Your teacher will download the NASA Global Observer app and create a classroom account.",
            "With your teacher, follow the app's instructions for the Mosquito Habitat Mapper."
         ],
         "instruction_steps_active":[
            "Click and print the additional resource \"Step by Step Tutorial for Mosquito Mapper\" above. It is helpful to review the tutorial and take it with you as you and your class start participating in this project.",
            "Click \"Participate Now\" below and you will be directed to the GLOBE Observer website, where you can go further to get the app Globe Observer on App Store or Google Play, or use the GLOBE Observer website. Create your GLOBE Observer account using the same email you used to sign up for SciStarter. If you are unsure which email you used, you can go to SciStarter Dashboard > Info & Settings > Signup Email. When you create your GLOBE account,  be sure to add \u201cscistarter\u201d in the referral field to earn full credit in SciStarter dashboard for your contributions to this project. ",
            "In the GLOBE Observer app, choose the Mosquito Habitat Mapper protocol. Turn on the location services on your mobile device. ",
            "A mosquito habitat observation with the GLOBE Observer app has up to four steps listed below (the first is required, the rest are optional depending on equipment and situation). The app has detailed instructions to walk you through each step.\r\n1) Identify and photograph potential mosquito habitats, i.e. sources of standing water.\r\n2) Sample and count mosquito larvae (requires a scoop or container to take a sample). Sample in your own yard or in public areas. Do not take samples on private property unless you have obtained permission. \r\n3) Identify larva type (requires magnification from a microscope or macrolens attachment).\r\n4) Eliminate the habitat, if possible.",
            "Click \"Make Mosquito Habitat Observation\", and the app will automatically download the date, time and the latitude / longitude of your location.  You will be able to verify the location by the map that is provided.",
            "Enter data as instructed. You can save at any time or proceed to the next steps.",
            "To finish, click \u201cSend All Mosquito Habitat Data Now\u201d or click \u201cReview/Edit Observations\u201d if you\u2019d like to review your data. You can always come back to send you data. ",
            "Want to do more? Complete the online \u201cMosquito\" tutorial and make use of all the additional resources available to you through the app.",
            "If you enjoyed this protocol, use your GLOBE Observer app to get involved in other important research in need of your help.",
            "Remember to mark this assignment as \"complete\" in order for your students to view a Thank You video, access a Reflections document, and to hear a special Citizen Science song to celebrate your participation!"
         ],
         "materials":[
            "Mobile device with camera.",
            "NASA GLOBE app (IOS or Android) or NASA GLOBE website",
            "Optional: to sample and count larvae, use:",
            "a phone clip-on microscope lens with a minimum of 35x magnification, white styrofoam plate, Ziploc style sandwich baggie, nylon style bulb syringe"
         ],
         "description":"<p>Citizen Scientists around the world use the GLOBE Observer Mosquito Habitat Mapper (GO Mosquito) app to locate and map locations of breeding sites. Earn points for decommissioning container habitats so that mosquito larvae don&rsquo;t develop into adult disease vectors. Besides promoting the collection of critical data for use by scientists and health officials, GO Mosquito fosters understanding of the importance of personal action in reducing the local risk of vector-borne disease.</p><p>This investigation focuses on\r\nmosquito larvae- the larva is\r\nan immature developmental\r\nstage that lives in water,\r\ndoesn&rsquo;t bite and doesn&rsquo;t pose\r\na health hazard to humans!</p>",
         "thanks":"<p>Thank you for contributing to our project!</p>",
