            "presenter":"NASA and The GLOBE Program",
            "goal":"Help scientists understand the sky from above and below",
            "task":"Photograph clouds, record sky observations and share with NASA",
            "description":"GLOBE Observer is an international citizen science initiative to understand our global environment. Your observations help scientists track changes in clouds in support of climate research. Scientists also use your data to verify NASA satellite data. And by submitting your observations, you can help students of all ages do real scientific research as part of the GLOBE Program. To participate, just download the app, go outside and follow the prompts in the app to observe your environment. Photograph clouds, record sky observations and compare them with NASA satellite images to help scientists understand the sky from above and below.\n\nWant to use GLOBE Observer: Clouds to address dust storms? Head over to this blog post to learn more: https://blog.scistarter.com/2019/07/nasa-globe-observer-needs-your-help-reporting-dust-storms/",
