         "instruction_steps_passive":[
            "After your teacher downloads the GLOBE Observer app,  your class will go outside and follow the prompts in the app to help scientists gather important data about clouds!"
         ],
         "instruction_steps_active":[
            "Click \"Participate Now\" below and you will be directed to the GLOBE Observer website, where you can go further to get the app Globe Observer on App Store or Google Play, or use the GLOBE Observer website. Create your GLOBE Observer account using the same email you used to sign up for SciStarter. If you are unsure which email you used, you can go to SciStarter Dashboard > Info & Settings > Signup Email. When you create your GLOBE account,  be sure to add \u201cscistarter\u201d in the referral field to earn full credit in SciStarter dashboard for your contributions to the GLOBE Observer project. ",
            "Find a location where you can see the sky. ",
            "It doesn't matter what time of day you and your students make and share observations, but, ideally, you'll find a few times that match when the GLOBE satellite is scheduled to orbit above you! (The app will help you locate those times.)",
            "On your mobile device, turn on location services.",
            "\r\nClick the Clouds protocol in the GLOBE Observer app.",
            "\r\nReview the app\u2019s introductory materials and click \u201cNext\u201d to interact with the dynamic tutorial and advance to the next section.",
            " \r\nClick \u201cNew Cloud Observation\" and enter the date and time of your students' observations. Use the app\u2019s map to confirm your location. If possible, wait until the reported accuracy is less than 50 meters.",
            "\r\nSelect the color of the sky that most closely matches the options shown to you. ",
            "\r\nSelect the amount of cloud coverage that most closely matches the options shown to you.",
            "\r\nSelect the type of cloud you and your class are viewing. You'll see pictures and descriptions of a variety of clouds to choose from.",
            "\r\nIf you'd like, you can upload pictures of the clouds you see!",
            "\r\nTo finish, click \u201cSend to GLOBE Now\u201d or click \u201cSave and Send Later\u201d if you\u2019re not connected to wi-fi or if you\u2019d like to review your data.",
            " \r\nWant to do more? Complete the online \u201cClouds\" tutorial and make use of all the additional resources available to you through the app.",
            "\r\nIf you enjoyed this protocol, use your GLOBE Observer app to get involved in other important research in need of your help.",
            "Remember to mark this assignment as \"complete\" in order for your students to view a Thank You video, access a Reflections document, and to hear a special Citizen Science song to celebrate your participation!"
         ],
         "materials":[
            "Mobile device with camera",
            "The GLOBE Observer app or website"
         ],
         "description":"<p>Clouds are a major component of the Earth&#39;s system that reflect, absorb, and scatter sunlight and infrared emissions from Earth. This affects how energy passes through the atmosphere. Different types of clouds have different effects, and the amount of cloud cover is also important. Clouds can change rapidly, so frequent observations are useful to track these changes. Such observations are able to see change over time and help with interpretation of satellite cloud data. The cloud observation tool in the GLOBE Observer app allows you to photograph clouds and record sky observations and compare them with NASA satellite images.&nbsp;</p><p>GLOBE Observer&#39;s goal is to provide a step-by-step process that helps you learn about clouds and their classification through simple observations and photography. You are an important part of the puzzle, providing a new perspective of the clouds that our NASA satellites do not have, looking up.&nbsp;</p><p>NASA is excited for you to start collecting data through this updated cloud protocol featuring NASA satellite comparison! Learn the basics of how to observe clouds with the GLOBE Observer App. Observations can be made anywhere and anytime. Open the app, select Clouds and follow the directions! Help scientists as a citizen scientist with your observations.&nbsp; &nbsp;(credit:&nbsp;<a href=\"https://www.youtube.com/redirect?q=https%3A%2F%2Fobserver.globe.gov%2F&redir_token=hDpG8xiLD5Ge0CYSW0diiX-Lss18MTU3NzU1NDg1OUAxNTc3NDY4NDU5&v=CNZGfeVaCHU&event=video_description\" rel=\"nofollow\" spellcheck=\"false\" target=\"_blank\">https://observer.globe.gov/</a> )</p>",
         "thanks":"<p>Thank you for sharing your observations with NASA!</p>",
         "time_required":"15 minutes",
