         "instruction_steps_active":[
            "Click the \"Additional Resources\" above to download or print the data sheets for a single count or multiple counts.",
            "Click the \"Participate\" button below to visit the Great Sunflower Project's website where you will need to create an account. Tip: To earn credit on SciStarter for your participation in this project, clic \"LOG IN\" in the upper right and then click on \"Log in using your SciStarter account\". When you are logged-in, please also check that your email address in your account is showing the correct lower-case letters.",
            "Start by recording the date, time and where you are.",
            "Choose a plant to watch and write down what type of plant it is (either a common name or scientific name).",
            "On that plant, decide how many flowers you are going to watch and write that down.",
            "If it is a plant with lots of flowers in a spike or bunch, you will need to count how many flowers are in that bunch. Once you are settled, start your timer and count (and record) the number of visits by pollinators and try to identify the pollinators.",
            "When you are done (try to do at least 5 minutes), return to the Great Sunflower Project website, log in, and click the \"ADD A COUNT\" button on the top menu bar and continue to enter data. Click \"FINISH\" to save your observation. Now, you are a proud citizen scientist!"
         ],
         "materials":[
            "Camera or smartphone with camera",
            "Computer or smartphone with Internet access",
            "GreatSunflower.org on web",
            "Optional:  Clip-on lens kit"
         ],
         "description":"<p>Join a community of gardeners, beekeepers, birders and naturalists who are providing thousands of records of pollinators each year. Your records are invaluable data on the state of our pollinators and are helping to build the best data set on plants and pollinators.</p><p>The best and most useful way to contribute to the Great Sunflower is to focus on a particular site or set of sites. Each time you visit your yard, favorite park or wild area, you can do a pollinator count on any of the plants in that space. Over time, this will be a list of the most important plants for each pollinator and give you an indication of which plants are important at what times of year.</p>",
         "thanks":"<p>Thank you for participating in this project!</p>",
         "time_required":"5 minutes each time",
