            "participant_instructions":"",
            "participant_instructions_email":"Climate change is changing us - our daily lives and livelihoods. What you notice in your own backyard can say a lot about weather and climate impacts for all of us. Even if you don\u2019t know it, you\u2019re an expert!\r\n\r\nHere\u2019s a few quick tips to get started:\r\n\r\nSign-up for you iSeeChange account here: https://www.iseechange.org/register\r\nJoin an investigation to dive deep into something you care about. From bugs to smog to heat and \u201cseasonal firsts,\u201d we\u2019ve got your interests covered. Follow at least one investigation to make the most of our project!\r\nTry to get up close to what you\u2019re seeing - and write a little about it! Think of your senses - what you see, what you hear, what you smell, what you touch, and what you taste are what we want to hear more about!\r\nUse your phone to add pictures. Pictures help us investigate what\u2019s happening - and they help get the conversation going. Landscape-shaped pictures (rather than portrait ones) work best, and we prefer you take the pictures yourself (or credit the photographer, if it\u2019s not you.)\r\nTake a look at other observations...and weigh in! You can tell other observers whether what they\u2019re seeing is weird, or normal, and compare what you see to other places.\r\nAsk questions...everywhere. In your own observations, and on our stories; of other people and our team. We\u2019ll always try to help you find answers.\r\nPlease don't hesitate to reach out. We can't do this without your support and curiosity, and we\u2019re glad you\u2019re here!\r\n\r\nSincerely,\r\nJulia Kumari Drapkin\r\niSeeChange Founder\r\njulia@iseechange.org",
