            "description":"What you see change in your backyard, neighborhood, and city is important to our understanding of how climate change and weather affect our communities. Your observations and block-by-block insights can help cities, engineers and local organizations advocate for and create solutions to climate challenges. \r\n\r\nWe welcome and host observations from people in 118 countries around the world and counting. We are also currently working with partners in New Orleans (LA), Miami (FL), Wilmington (NC), and Ocean City (NJ) on specialized investigations. \r\n\r\nIf you or your community has a question or hypothesis about how climate is changing your area, you can also use your ISeeChange account to collect data and answer those questions.",
