         "instruction_steps_passive":[
            "Take a look all around you. Look up, look down. Close your eyes and think about what you saw.",
            "Scientists, city planners, and curious members of your community invite you to document your observations. When you spot the  first snow, or the first robin or budburst, report it to ISeeChange. Are plants and trees blooming early? Report when spring shows up unexpectedly.",
            "Make sightings about YOU! Describe how weather and climate impact your life and lifestyle!",
            "Search for investigations of interest to you and your class, then, start sharing your reports with your teacher online or through the ISeeChange app. ",
            "Remember, each sighting will be paired with satellite, weather, and other data to help  identify local level changes that correlate with bigger picture trends. Investigations can empower communities to develop baseline data and participate in adaptation decisions."
         ],
         "instruction_steps_active":[
            "Click \"Participate now\" below and you will be directed to where you can download the free app \"ISeeChange Tracker\" from App Store or Google Play. Or, use the website.",
            "Set up your account using the same email address you used to create your SciStarter account. If you are unsure which email address you used, go to SciStarter Dashboard> Info and Settings > and check your \"Signup Email\" address. Your contributions to ISeeChange will be credited in your SciStarter Dashboard!",
            "Let's go outside to take a look all around. Look up; look down. Close your eyes and think about what you saw.",
            "Scientists, city planners, and curious members of your community invite you to document your observations. When you spot the  first snow, or the first robin or budburst, report it to ISeeChange. Are plants and trees blooming early? Report when spring shows up unexpectedly.",
            "Make sightings about YOU! Describe how weather and climate impact your life and lifestyle!",
            "Search for investigations of interest to you and your class. Then, start sharing your reports online or through the ISeeChange app.",
            "Your data will be paired with satellite, weather, and other data to help identify local level changes that correlate with bigger picture trends. Investigations can empower communities to develop baseline data and participate in adaptation decisions."
         ],
         "materials":[
            "Computer or smartphone",
            "Internet",
            "ISeeChange app or website"
         ],
         "description":"<p>As the climate continues to change, it&rsquo;s critical to understand how and what we can do to adapt. ISeeChange is dedicated to empowering communities to document and understand their environment, weather and climate in order to increase resilience. This platform, tools, and investigations provide equitable, iterative ways for residents to personalize, measure, and track climate change impacts and better participate in community adaptation decisions.</p><p>ISeeChange is a global community that posts about what they notice changing in the environment using our platform and mobile tools. Each post is synced with weather and climate data and broadcast to the community to investigate bigger picture climate trends. Over time, community members can track how climate is changing, season to season, year to year, and understand the impacts on daily life.</p><p>Pick an investigation that the ISeeChange partners are actively researching and add sightings from your own backyard, neighborhood or city.</p><p>Each sighting will be paired with satellite, weather, and other data to help identify local level changes that correlate with bigger picture trends. Investigations can empower communities to develop baseline data and participate in adaptation decisions.</p>",
         "thanks":"<p>Thank you for sharing your observations and documenting changes in our Earth&#39;s climate.</p>",
