            "presenter":"Izaak Walton League of America",
            "goal":"Map streams across the country and start testing the waters.",
            "task":"Simply snap a pic of your local stream and share it!",
            "description":"What's in YOUR water? We all have the right to know if the streams running through our backyards and neighborhood parks are safe. But there is an alarming lack of up-to-date information about water quality across the country. Stream Selfie is here to bridge that information gap.\r\n\r\nStream Selfie connects you with thousands of other citizen scientists to paint a picture of streams across America. Simply snap a pic of your local stream and share it here.\r\n\r\nYour photo is step one in our effort to check the health of every stream in the country \u2013 far more streams than state and local agencies have the resources to check!\r\n\r\nThousands of people are working toward a common goal: clean water. Will you join us?",
