            "data_results":"This data will go on a map of the United States and into our database. The data will help us to determine potential water quality monitoring locations. This data will then help us to determine if we have locations to send volunteers and members once they are ready to begin water monitoring. This data will also be used to determine what stream sites are currently being monitored for water quality and what sites could be monitored for water quality by members, volunteers and students.",
