         "instruction_steps_passive":[
            "With your teacher, you will select a safe stream, creek, or river in your community.",
            "Your teacher will guide your class in taking pictures of the stream.\r\n \r\nObserve the conditions of the stream: Do you see trash? Is the stream flowing? ",
            "Your teacher will help add pictures, observations and data to the Stream Selfie form on SciStarter.",
            "Review the map of other Stream Selfies. There are plenty of streams to map with more than 3 million miles of streams and rivers flowing through the United States!",
            "Add more Stream Selfies and observations or share your reflections with your teachers.",
            "Watch the Thank You video, celebrate with a special song, and keep an eye out for your Stream Selfie certificate!"
         ],
         "instruction_steps_active":[
            "Click and print the additional resource \"Data Collection Worksheet\" above. It's helpful to review the questions on the worksheet and take it with you as you start observing streams. ",
            "With your class or group, locate a safe stream, creek, or river in your community.",
            "Head to the stream with a phone or camera.",
            "Snap a picture of the stream (with or without your class or group in it!) and observe the conditions of the stream.",
            "Click \"Participate Now\" below to upload the pictures, observations and data you recorded on your worksheet  to the online Stream Selfie data submission form on SciStarter.",
            "Review the map of other Stream Selfies. There are plenty of streams to map with more than 3 million miles of streams and rivers flowing through the United States!"
         ],
         "materials":[
            "Camera or phone with a built in camera",
            "Stream Selfie Data Sheet",
            "Pen or Pencil"
         ],
         "description":"<p>What&#39;s in YOUR water? We all have the right to know if the streams running through our backyards and neighborhood parks are safe. But there is an alarming lack of up-to-date information about water quality across the country. Stream Selfie is here to bridge that information gap.</p><p>Simply snap a photo of a stream that&rsquo;s important to you, answer a few key questions, and share your picture which will appear on the Stream Selfie map on SciStarter and on the Izaak Walton League&#39;s websites. &nbsp;With each photo, we are also creating a first-of-its-kind national map for volunteers and community organizations involved with stream monitoring. By putting this information in one place, we can highlight streams that are being monitored to check the health of the water and develop a national inventory of streams that need to be monitored in the future.&nbsp;</p><p>Your photo is step one in an effort to check the health of every stream in the country &ndash; far more streams than state and local agencies have the resources to check!</p><p>Thousands of people are working toward a common goal: clean water. Will you join us?</p>",
         "thanks":"<p>Thank you for adding your stream selfie to our national map. Are you interested in doing more to keep streams safe in your community? The Izaak Walton League has tips and tools to help you, no matter where you live or what level of experience you have. Find ideas for your Next Steps here! <a href=\"https://www.iwla.org/conservation/water/clean-water-challenge/take-the-next-step-in-the-clean-water-challenge\">https://www.iwla.org/conservation/water/clean-water-challenge/take-the-next-step-in-the-clean-water-challenge</a></p>",
         "time_required":"Approx. 15 minutes at the stream",
