         "instruction_steps_passive":[
            "With your teacher, your class will select a location to observe squirrels.",
            "Take notes to record the food squirrels might find and the threats they might face in the area.",
            "If you see a squirrel, make a note of its color and, if you can, take a picture.",
            "Your teacher will upload the observations and pictures to the Project Squirrel form.",
            "The project scientist will analyze the data and use it to understand more about squirrels, what they eat and where they live.",
            "Once your teacher marks this assignment as complete, you will receive a Citizen Scientist certificate, and, in some cases, you can share your reflections, view a thank you video, and celebrate with a special song!"
         ],
         "instruction_steps_active":[
            "Click and print the additional resource \"Data Collection Worksheet\" above. It's helpful to review the questions on the worksheet and take it with you as you start looking for squirrels!",
            "Select a location to observe squirrels.",
            "See a squirrel? Great! Use your worksheet to record data.  If you can, take a picture, and upload your picture and data online by clicking \"Participate Now\" below. ",
            "No squirrels in your neighborhood today?  You can still click \"Participate Now\" below and report a lack of squirrels. Absence (or \"zero\") of squirrels is also a data point.  This is especially interesting if the surrounding communities have squirrels.",
            "The project scientists will analyze the data and use it to help understand more about squirrels, where they live and what they eat."
         ],
         "materials":[
            "smart phone or camera",
            "\r\nProject Squirrel data form",
            "\r\nPen or pencil"
         ],
         "description":"<p>Project Squirrel needs your help to count the number and types of squirrels you see near you to help scientists understand tree squirrel ecology. You might have grey (or &ldquo;black&rdquo;), fox, and red squirrels while a nearby town might only have one species. In many places, it seems one species or another is becoming more common. Help discover why.</p><p>In this project, you will learn how to identify these three tree squirrels then, with the help of your teacher, report your observations about their presence or absence in your neighborhood.</p>",
         "thanks":"<p>Thank you for your observations!&nbsp;</p><p>Check the status of your <a href=\"/broward/teacher/students\">students&#39; assignments</a>, <a href=\"/broward/teacher/projects\">mark this assignment as completed</a>, or <a href=\"/broward/teacher/projects\">select another project</a></p>",
         "time_required":"15 minutes",
